const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True Name: Jeanne Darc</li><li>Gender: Female</li><li>Source: \u300EServant Summer Festival!\u300F</li><li>Origin: France</li><li>Alignment: Chaotic Summer</li><li>Height: 159 cm</li><li>Weight: 44 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Higashide Y\u016Bichir\u014D</li><li>Character designer: Takeuchi Takashi</li><li>CV: Sakamoto M\u0101ya</li><li>Main appearances: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Mad Enhancement: [EX]</strong></p><p>\u300CManga? Me? What stupid things are you saying?<br> Did a worm hatch in your brains?\u300D<br> \u2193<br> \u300COf course it\u2019s wrong, this won\u2019t beat that d\u014Djin\u2026!\u300D<br> \u300CI\u2019m going to draw, with all my body and soul\u2026!\u300D</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Schwartzwald Falke: [B]</strong></p><p>German. It\u2019s translated as falcon of the black forest, but\u2026 There\u2019s no meaning\u2026 in particular\u2026.<br> Seems it was added \u300Cbecause it\u2019s somewhat cool\u300D.<br> Mysterious power.[1]</p><p><strong>Fallen Witch: [A+]</strong></p><p>A transformation of the Dragon Witch skill,<br> due to the shift from the Avenger class.</p><p><strong>Meurs O\xF9 Tu Dois: [EX]</strong></p><p>Accurately, it\u2019s \u201CVa o\xF9 tu peux, meurs o\xF9 tu dois\u201D.<br> Go to the place you must go, die at the place you must die\u2026 A French proverb.<br> For one reason or another, she who is an Avenger is looking for a place to die.<br> Not a pleasant, gentle death.<br> No matter how intense, how desperate it is.<br> Hoping that\u2019s a satisfactory departure,<br> she continues fighting every day.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="volkemord-feuerdrache-incinerated-rule-of-heaven-\xB7-dragon-of-extermination" tabindex="-1"><a class="header-anchor" href="#volkemord-feuerdrache-incinerated-rule-of-heaven-\xB7-dragon-of-extermination" aria-hidden="true">#</a> V\xF6lkemord Feuerdrache - Incinerated Rule of Heaven \xB7 Dragon of Extermination</h1><ul><li>Rank: A+</li><li>Type: Anti-Army</li><li>Range: 1~5</li><li>Maximum number of targets: 50 people</li></ul><p>V\xF6lkemord Feuerdrache.<br> In order to compete with Jeanne Darc, the mountain instead of the sea.<br> Born of the idea of using fire instead of water.<br> Summons a black dragon-like thing with her power as the former Dragon Witch, and spreads disaster.<br> It\u2019s not necessary to say the reason why it\u2019s in German anymore.<br> Because it\u2019s cool.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First person pronoun: \u79C1 (watashi)<br> Second person pronoun: \u30A2\u30F3\u30BF (anta)<br> Third person pronoun: \u5F7C (kare) / \u5F7C\u5973 (kanojo)</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>She became a Berserker from Avenger, but perhaps because the basis was easy to transform, the difference isn\u2019t rather significant.<br> If anything, it\u2019s to the point that the serious elements have disappeared.<br> She changed into a swimsuit and was full of motivation to enjoy Hawaii, but because she obtained a certain d\u014Djinshi, the world changed.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>The usual familiar friend attitude.<br> She thinks it\u2019s natural to involve him/her, and believes they\u2019ll naturally follow her.</p><p>Even if the separation is contracted, even if she will eventually wake from her dream.<br> These memories are eternally hers.</p><p>As long as there\u2019s that fact, she will always proceed to battle.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300CThe time has come. It is the beginning of Sabbath!<br> The crows sing, sing\u2026, the black cat goes meow!\u300D</p><p>\u300CO\u2019 three-headed black dragon,<br> eat away the world!<br> V\xF6lkemord Feuerdrache!\u300D</p><p>\u300CTirelessly re-raising me from scratch.<br> You, do you like me that much?<br> Huum, well I\u2019m a Servant<br> so I can\u2019t answer to your feelings, though.<br> At least I\u2019ll allow you to be at my side.<br> \u2026 What\u2019s with those eyes?\u300D</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>A central character in the summer event \u300CServant Summer Festival!\u300D.<br> She started up the circle \u300EGespenst Ketzer\u300Fand continued drawing manga together with the protagonist.<br> Everything was because of her rivalry to Jeanne Darc, but it seems that there was at its basis there was something that couldn\u2019t be attained without hatred and longing for\u300Ethe development that was inconceivable\u300F,\u300Ethe story that should have been fulfilled\u300F.</p><p>It is said that, after the summer event ended, even if she was amazed at herself and asked\u300CWhy was I so frantic?\u300D, her sense of distance with liberal arts Servants is closer than before.</p><p>Also, as an aside, she won\u2019t overlook that the reason why she was in such high spirits was because of Luluhawa\u2019s air.<br> She was so looking forward to this trip that she read the airplane&#39;s guidebook taking notes with post-its.</p><p>Although she spent her days busy with manga, having been able to fully enjoy Luluhawa by making a loop became a memory she won\u2019t forget in her whole life.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Japanese blade \uFF583<br> \xB7 Arahabaki[2] 72 Flashes (Arahabaki Nana J\u016B Ni Sen)<br> \xB7 Great Black Poison Dragon All-Destruction (Black Mamba)<br> \xB7 Mumei</p><p>She left the third one without a name on purpose.<br> \u300CIn English, it\u2019s Nameless\u2026\u300D</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Jeanne Darc (Swimsuit)</strong></p><p>Hah, how pathetic I am for being move by such a book.<br> I will cut that karma apart, and exceed it\u2026!<br> (\u203B It\u2019s the manga you drew)</p><p><strong>Other swimsuit characters</strong></p><p>Everyone\u2019s as festive as they please\u2026<br> What do they think Luluhawa is\u2026?<br> (\u203B You\u2019re the one who\u2019s being festive)</p><p><strong>Osakabehime</strong></p><p>I learned very well the know-how of d\u014Djins.<br> Maybe it\u2019s because we didn\u2019t have any connection in life, but I often go visit her room and read a book.</p><p><strong>King of the Cavern</strong></p><p>I feel like this man\u2019s high-spirited speech has recently become a habit.<br> If I get careless, the characters\u2019 speech will turn similar.</p><p><strong>Shakespeare</strong></p><p>Are you doing this story, this genre, this material too?!<br> Weren\u2019t you interested in, like, preserving materials for humans of later generations?!</p><p><strong>Sieg</strong></p><p>He transforms into Fafnir, that means he\u2019s in essence my subordinate?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Let\u2019s make Jeanne Alter\u2019s swimsuit a swimsuit form that is cool for her! With that thought I designed her. I think it\u2019s as if she agreed on this line without hesitation. The Noble Phantasm performance is wonderful too, but I personally like her Extra attack the most. Break all of you, I win. (Takeuchi Takashi)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL Notes</h2><p>[1]: I don\u2019t care I\u2019m not supposed to take swimsuit Servants seriously, but this has to be the biggest middle finger to us ever.</p><p>[2]: A god after which clay dolls known as Shak\u014Dkidog\u016B were said to be modeled. You\u2019ll probably know about them if you\u2019ve played SMT: P4. They have ties to the Ainu, so it&#39;s extremely hard to find much information unless you&#39;re an expert moon reader.</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 64);
